/*Table structure for table `cc_gprs_card` */

DROP TABLE IF EXISTS `cc_gprs_card`;

CREATE TABLE `cc_gprs_card` (
  `card_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '流量卡编号',
  `org_id` int(11) NOT NULL DEFAULT '0' COMMENT '机构编号',
  `batch_id` int(11) unsigned NOT NULL COMMENT '批次增号',
  `card_sn` varchar(15) DEFAULT NULL COMMENT '卡号码',
  `card_name` varchar(30) DEFAULT NULL COMMENT '流量卡别名',
  `card_iccid` varchar(20) NOT NULL COMMENT '卡ICCID',
  `is_normal` tinyint(1) DEFAULT '1' COMMENT '0停号1正常',
  `owner_name` varchar(15) DEFAULT NULL COMMENT '卡主姓名',
  `owner_gender` tinyint(1) DEFAULT '0' COMMENT '卡主性别0保密1男2女',
  `owner_cdi` varchar(20) DEFAULT NULL COMMENT '卡主身份证',
  `gprs_month` decimal(10,2) DEFAULT '0.00' COMMENT '每月赠送流量数',
  `used_total` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '累记使用流量(MB)',
  `unicom_stop` decimal(10,2) DEFAULT '0.00' COMMENT '联通',
  `used_month` decimal(10,2) DEFAULT '0.00' COMMENT '当月使用流量(MB)',
  `pay_total` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '累记充值流量(MB)',
  `pay_unused` decimal(10,2) DEFAULT '0.00' COMMENT '可使用充值流量(MB)[当gprs_month-used_month<=0则=pay_unused-(车机used_month-数据表used_month),当有充值则=pay_unused+充值的流量]',
  `max_unused` decimal(10,2) DEFAULT '0.00' COMMENT '最大可使用流量(MB)[当gprs_month-used_month<=0则=pay_unused反知则=pay_unused+(gprs_month-used_month)]',
  `time_added` datetime DEFAULT NULL COMMENT '激活时间',
  `time_last` datetime DEFAULT NULL COMMENT '最后时间',
  `time_paid` datetime DEFAULT NULL COMMENT '上次充值时间',
  `time_stop` datetime DEFAULT NULL COMMENT '上次停号时间',
  `time_expire` datetime DEFAULT NULL COMMENT '过期时间',
  PRIMARY KEY (`card_id`),
  UNIQUE KEY `card_iccid` (`card_iccid`)
) ENGINE=InnoDB AUTO_INCREMENT=8118 DEFAULT CHARSET=utf8 COMMENT='GPRS流量卡信息表';

