/*Table structure for table `cc_gprs_czk` */

DROP TABLE IF EXISTS `cc_gprs_czk`;

CREATE TABLE `cc_gprs_czk` (
  `czk_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '充值卡增号',
  `zck_code` varchar(20) NOT NULL COMMENT '充值卡编码',
  `zck_value` decimal(10,2) NOT NULL COMMENT '充值卡金额(元)',
  `zck_gprs` decimal(10,2) NOT NULL COMMENT '充值流量值(MB)',
  `org_id` int(11) NOT NULL DEFAULT '0' COMMENT '机构编号',
  `card_id` int(11) unsigned DEFAULT NULL COMMENT '流量卡编号（给哪张卡充值了）',
  `live_month` int(5) DEFAULT '3' COMMENT '有几个月的生命期',
  `time_used` datetime DEFAULT NULL COMMENT '充值时间',
  `time_added` datetime DEFAULT NULL COMMENT '生卡时间',
  `time_expire` date DEFAULT NULL COMMENT '有效时间',
  PRIMARY KEY (`czk_id`),
  UNIQUE KEY `zck_code` (`zck_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='GPRS充值卡表';

/*Data for the table `cc_gprs_czk` */

/*Table structure for table `cc_gprs_log` */

DROP TABLE IF EXISTS `cc_gprs_log`;

CREATE TABLE `cc_gprs_log` (
  `log_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'GPRS日志增号',
  `card_id` int(11) unsigned NOT NULL COMMENT '流量卡编号',
  `up_gprs` decimal(10,2) DEFAULT '0.00' COMMENT '上行流量(MB)',
  `down_gprs` decimal(10,2) DEFAULT '0.00' COMMENT '下行流量(MB)',
  `time_added` datetime DEFAULT NULL COMMENT '上报时间',
  PRIMARY KEY (`log_id`),
  KEY `card_id` (`card_id`)
) ENGINE=MyISAM AUTO_INCREMENT=37429 DEFAULT CHARSET=utf8 COMMENT='GPRS日志表';

