/*Table structure for table `cc_gprs_pack` */

DROP TABLE IF EXISTS `cc_gprs_pack`;

CREATE TABLE `cc_gprs_pack` (
  `pack_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '套餐编号',
  `org_id` int(11) NOT NULL DEFAULT '0' COMMENT '机构编号',
  `gprs_amount` decimal(10,2) DEFAULT '0.00' COMMENT '流量(MB)',
  `gprs_price` decimal(10,2) DEFAULT '0.00' COMMENT '价格(元)',
  `gprs_memo` varchar(200) DEFAULT '' COMMENT '充值备注',
  `gprs_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：0停用 1启用',
  `live_month` int(5) DEFAULT '3' COMMENT '有几个月的生命期',
  `time_added` datetime DEFAULT NULL COMMENT '添加时间',
  `time_modify` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`pack_id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='流量充值套餐表';

