/*Table structure for table `cc_gprs_pay` */

DROP TABLE IF EXISTS `cc_gprs_pay`;

CREATE TABLE `cc_gprs_pay` (
  `pay_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'GPRS充值编号',
  `card_id` int(10) NOT NULL DEFAULT '0' COMMENT '流量卡编号',
  `org_id` int(11) NOT NULL DEFAULT '0' COMMENT '机构编号',
  `gprs_amount` decimal(10,2) DEFAULT '0.00' COMMENT '流量(MB)',
  `gprs_price` decimal(10,2) DEFAULT '0.00' COMMENT '价格(元)',
  `gprs_memo` varchar(200) DEFAULT '' COMMENT '充值备注',
  `pay_method` tinyint(1) DEFAULT '0' COMMENT '付款方式：1微信，2支付宝，3充值卡，4转账',
  `transfer_id` varchar(64) DEFAULT '' COMMENT '支付流水号',
  `is_paid` tinyint(1) DEFAULT '0' COMMENT '是否已支付:1已付款2未付款',
  `time_paid` datetime DEFAULT NULL COMMENT '付款时间',
  `time_added` datetime DEFAULT NULL COMMENT '充值时间',
  PRIMARY KEY (`pay_id`),
  KEY `card_id` (`card_id`),
  KEY `org_id` (`org_id`)
) ENGINE=InnoDB AUTO_INCREMENT=173 DEFAULT CHARSET=utf8 COMMENT='GPRS流量充值表';

