/*Table structure for table `cc_gprs_stats` */

DROP TABLE IF EXISTS `cc_gprs_stats`;

CREATE TABLE `cc_gprs_stats` (
  `stats_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'GPRS统计增号',
  `card_id` int(11) unsigned NOT NULL COMMENT '流量卡编号',
  `how_month` int(11) DEFAULT NULL COMMENT '月份:201601',
  `month_used` decimal(10,2) DEFAULT '0.00' COMMENT '月使用流量(MB)',
  `month_over` decimal(10,2) DEFAULT '0.00' COMMENT '月超标流量(MB)',
  `time_modify` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`stats_id`),
  UNIQUE KEY `card2month` (`card_id`,`how_month`)
) ENGINE=MyISAM AUTO_INCREMENT=781 DEFAULT CHARSET=utf8 COMMENT='GPRS统计表';

