  `time_added` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `time_modify` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`news_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='文章表';

/*Data for the table `cc_news` */

insert  into `cc_news`(`news_id`,`news_name`,`news_author`,`news_status`,`news_look`,`is_show`,`news_commend`,`news_keyword`,`news_synopsis`,`news_content`,`time_added`,`time_modify`) values (1,'php防止sql注入','通少',1,0,1,1,'sql注入','http://www.phplaozhang.com/article/42.html','&lt;p&gt;&lt;b&gt;三个函数：&lt;/b&gt;&lt;/p&gt;&lt;p&gt;addslashes($string):用反斜线引用字符串中的特殊字符&#039; &quot; &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$username=addslashes($username);&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;mysql_escape_string($string)：用反斜杠转义字符串中的特殊字符，用于mysql_query()查询。&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$username=mysql_escape_string($username);&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;mysql_real_escape_string($string)：转义SQL语句中使用的字符串中的特殊字符，并考虑到连接的当前字符集，需要保证当前是连接状态才能用该函数，否则会报警告。 不转义%与_&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$username=mysql_real_escape_string($username);&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;两种选择：&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;使用PDO&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$stmt = $pdo-&amp;gt;prepare(&#039;SELECT * FROM user WHERE name = :name&#039;);&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$stmt-&amp;gt;execute(array(&#039;:name&#039; =&amp;gt; $name));&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;foreach ($stmt as $row) {&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;// do something with $row&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;}&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;使用mysqli&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$stmt = $dbConnection-&amp;gt;prepare(&#039;SELECT * FROM user WHERE name = ?&#039;);&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$stmt-&amp;gt;bind_param(&#039;s&#039;, $name);&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$stmt-&amp;gt;execute();&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;$result = $stmt-&amp;gt;get_result();&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;while ($row = $result-&amp;gt;fetch_assoc()) {&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;// do something with $row&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;}&lt;/p&gt;','2017-10-09 11:27:59','2017-10-09 14:49:00');

